INSERT INTO `rv_email_template` (`id`, `name`, `title`, `text`, `update_operatinger_id`, `update_date`) VALUES
(1, 'monthly_start', '{year}年{month}月  績效評核通知', '<h3>您好：</h3><p>本月份績效評核作業已開啟，考勤區間為上月<font color="red">{day_start}日</font>至本月<font color="red">{day_end}日</font>止，請各主管儘速於 <font color="red">{cut_off_date}</font> 前完成評核作業，謝謝！</p>\r\n<p>入口網址：<a href="http://{URL}">{URL}</a></p><p>帳 號：員編</p><p>密 碼：身分證字號（預設）</p><br><br><p>人力資源處</p>', 0, '2017-04-11 08:15:29'),
(2, 'monthly_return', '【駁回通知】{year}年{month}月 {unit_id} {unit_name} 績效評核表已駁回', '<h3>您好：</h3><p>本月份送審之 【 {unit_id} {unit_name} 】績效評核表已駁回，請儘速完成評核作業，謝謝！</p><p>入口網址： <a href="http://{URL}">{URL}</a></p><p>帳     號：員編</p><p>密     碼：身分證字號（預設）</p><br><br> <p>人力資源處</p>', 0, '2017-04-11 11:29:47'),
(3, 'monthly_arrive', '【考評通知】{year}年{month}月 {unit_id} {unit_name} 績效評核表已送達', '<h3>您好：</h3><p>本月份送審之【 {unit_id} {unit_name} 】績效評核表已送達至您，請儘速完成評核作業，謝謝！</p><p>入口網址： <a href="http://{URL}">{URL}</a></p><p>帳     號：員編</p><p>密     碼：身分證字號（預設）</p><br><br><p>人力資源處</p>', 0, '2017-04-11 11:28:51'),
(4, 'monthly_pause', '【考評暫停通知】{year}年{month}月 績效評核表 暫時關閉', '<h3>您好：</h3><p>本月份送審之績效評核表暫時關閉，如有不便之處請見諒，謝謝！</p><br><br><br><p>人力資源處</p>', 0, '2017-04-11 10:35:57'),
(5, 'monthly_delay', '【考評通知】{year}年{month}月 績效評核表', '<h3>您好：</h3><p>本月份送審之績效評核表已到截止時間 <font color="red"> ( {cut_off_date} ) </font>，請儘速完成評核作業，謝謝！</p><p>入口網址： <a href="http://{URL}">{URL}</a></p><p>帳     號：員編</p><p>密     碼：身分證字號（預設）</p><br> <br><p>人力資源處</p>', 0, '2017-04-11 13:15:43'),
(9, 'monthly_assessment_finish', '【考評核准通知】{year}年{month}月 績效評核表', '<h3>您好：</h3><p>此月份考評單已經全部核准 </p> <p>特此通知</p>', 0, '2017-08-04 09:43:15'),
(10, 'monthly_draw', '【考評通知】{year}年{month}月 {department} 績效評核表抽單', '<h3>您好：</h3><p>本月份送審之【 {department} 】績效評核表已被 {staff_name} 給抽回</p><p> 入口網址: <a target="_blank" href="http://{URL}">{URL}</a> </p> <p> 帳     號：員編 </p> <p>密     碼：身分證字號（預設） </p> <br><br> <p>人力資源處</p>', 0, '2017-08-25 03:05:28'),
(11, 'yearly_assessment_staff_commit', '【年度考評 - 送達通知】{year}年 ** {unit_id}{department_name} {staff_name_en} {staff_name} ** 年度考核表已提交', '<h3>您好：</h3><p> {year} 年度 {unit_id}{department_name} {staff_name_en} {staff_name} 送審之年度考核表已抵達您的手中，請儘速完成評核作業，謝謝！<p> 入口網址: <a target="_blank" href="{URL}">{URL}</a> </p> <p> 帳     號：員編 </p> <p>密     碼：身分證字號（預設） </p> <br><br> <p>人力資源處</p>', 0, '2017-11-09 03:58:08'),
(12, 'yearly_assessment_to_director_commit', '【年度考評 - 送達通知】{year}年【{unit_id}{division_name}】年度考核表已全數收齊', '<h3>您好：</h3><p> {year} 年度 {unit_id}{division_name} 送審之年度考核表已全數抵達部門單位，特此通知，請等待所有部門將個人考核表完成，謝謝！</p> <br><br> <p>人力資源處</p>', 0, '2017-11-09 03:25:35'),
(13, 'yearly_division_to_consturct', '【年度考評 - 待確認通知】{year}年【{unit_id}{division_name}】年度考核表', '<h3>您好：</h3><p> {year} 年度 {unit_id}{division_name}  送審之年度考核表已送達 {owner_staff_name} {owner_staff_name_en} 的手中，請儘速完成確認作業，謝謝！<p> 入口網址: <a target="_blank" href="{URL}">{URL}</a> </p> <p> 帳     號：員編 </p> <p>密     碼：身分證字號（預設） </p> <br><br> <p>人力資源處</p>', 0, '2017-11-09 03:24:59'),
(14, 'yearly_division_to_ceo', '【年度考評 - 待批准通知】{year}年【{unit_id}{division_name}】年度考核表', '<h3>您好：</h3><p> {year} 年度 {unit_id}{division_name}  送審之年度考核表已抵達 {owner_staff_name} {owner_staff_name_en} 的手中，請儘速完成評核作業，謝謝！<p> 入口網址: <a target="_blank" href="{URL}">{URL}</a> </p> <p> 帳     號：員編 </p> <p>密     碼：身分證字號（預設） </p> <br><br> <p>人力資源處</p>', 0, '2017-11-09 03:25:05'),
(15, 'yearly_division_to_system', '【年度考評 - 批准通知】{year}年【{unit_id}{division_name}】年度考核表', '<h3>您好：</h3><p> {year} 年度 {unit_id}{division_name} 之年度考核已全數完成，特此通知！<p> 入口網址: <a target="_blank" href="{URL}">{URL}</a> </p> <p> 帳     號：員編 </p> <p>密     碼：身分證字號（預設） </p> <br><br> <p>人力資源處</p>', 0, '2017-11-09 03:25:11'),
(16, 'yearly_assessment_to_reject_to_staff', '【年度考評 - 駁回通知】{year} 年 **{unit_id}{department_name} {staff_name_en} {staff_name}** 的年度考核表已駁回', '<h3>您好：</h3><p> {year} 年度 {unit_id}{department_name}  {staff_name_en} {staff_name} 送審之年度考核表已駁回，請儘速完成評核作業，謝謝！</p> <p>駁回原因：<span>{reason}</span></p>入口網址: <a target="_blank" href="{URL}">{URL}</a> </p> <p> 帳     號：員編 </p> <p>密     碼：身分證字號（預設） </p> <br><br> <p>人力資源處</p>', 0, '2017-11-09 03:10:36'),
(17, 'yearly_division_reject_to_director', '【年度考評 - 駁回通知】{year}年【{unit_id}{division_name}】年度考核表', '<h3>您好：</h3><p> {year} 年度 {unit_id}{division_name} 送審之年度部門單位考核表已駁回 {owner_staff_name} {owner_staff_name_en} 的手中，請儘速完成評核作業，謝謝！<p> 入口網址: <a target="_blank" href="{URL}">{URL}</a> </p> <p> 帳     號：員編 </p> <p>密     碼：身分證字號（預設） </p> <br><br> <p>人力資源處</p>', 0, '2017-11-09 03:24:32'),
(18, 'yearly_assessment_to_delay', '【年度考評通知】 {year} 年 **{unit_id}{department_name} {name_en} {name}** 年度考核表', '<h3>您好：</h3><p> {year} 年度考核作業已過截止時間 ( {assessment_date_end} ) ，請儘速完成評核作業，謝謝！<p> 入口網址: <a target="_blank" href="{URL}">{URL}</a> </p> <p> 帳     號：員編 </p> <p>密     碼：身分證字號（預設） </p> <br><br> <p>人力資源處</p>', 0, '2017-11-07 09:28:37'),
(19, 'yearly_feedback_launch', '【年度考評通知】 {year} 年部屬回饋問卷調查。', '<h3>您好：</h3><p>本年度「部屬回饋問卷調查」已開始進行，敬請同仁儘速於<font color="red">{day_end}</font>前完成問卷調查，謝謝！</p>\r\n<p>入口網址：<a href="http://{URL}">{URL}</a></p><p>帳 號：員編</p><p>密 碼：身分證字號（預設）</p><br><br><p>人力資源處</p>', 0, '2017-11-06 11:16:49'),
(20, 'yearly_feedback_close', '【年度考評通知】 {year} 年部屬回饋問卷調查已經停止。', '<h3>您好：</h3><p>本年度「部屬回饋問卷調查」已停止，暫時不再接收部屬回饋之意見，謝謝！</p><br><br><p>人力資源處</p>', 0, '2017-11-06 12:07:41'),
(21, 'yearly_feedback_commit', '【年度考評通知】 {year} 年 ** {name_en} {name} ** 的部屬回饋問卷調查已提交。', '<p>本年度「部屬回饋問卷調查」由 【{name_en} {name}】 對 【{target_name_en} {target_name}】的問券已經提交，</p><br><br><p>人力資源處</p>', 0, '2017-11-07 03:31:56'),
(22, 'yearly_feedback_delay', '【年度考評通知】 {year} 年 部屬回饋問卷尚未提交。', '<h3>您好：</h3><p>本年度「部屬回饋問卷調查」已至結束日〈<font color="red">{day_end}</font>〉，敬請同仁儘速完成問卷調查，謝謝！</p>\r\n<p>入口網址：<a href="http://{URL}">{URL}</a></p><p>帳 號：員編</p><p>密 碼：身分證字號（預設）</p><br><br><p>人力資源處</p>', 0, '2017-11-07 08:16:01'),
(23, 'yearly_assessment_launch', '【年度考評通知】 {year} 年度績效考核作業開啟。', '<h3>您好：</h3><p>本年度「績效考核作業」已開始進行，敬請同仁儘速完成自評作業；</p><p>各部門考核作業請於{year}年{month}月{day}日前完成，謝謝！</p><p>【人事考評系統】</p>\r\n<p>入口網址：<a href="http://{URL}">{URL}</a></p><p>帳 號：員編</p><p>密 碼：身分證字號（預設）</p><br><br><p>人力資源處</p>', 0, '2017-11-08 11:48:26'),
(24, 'yearly_assessment_pause', '【年度考評通知】 {year} 年度績效考核作業暫停。', '<h3>您好：</h3><p>本年度「績效考核作業」已暫停</p><p>各部門考核作業暫時無法操作，敬請見諒！</p><br><br><p>人力資源處</p>', 0, '2017-11-08 11:49:53'),
(25, 'yearly_assessment_all_report_done', '【年度考評通知】 {year} 年度績效考核作業 部門單位評核。', '<h3>您好：</h3><p>本年度「績效考核作業」個人考核表已全數完成。</p><p>開始進入部門級別單位之加減分，請盡速完成各部門考核作業，謝謝！</p><p> 入口網址: <a target="_blank" href="{URL}">{URL}</a> </p> <p> 帳     號：員編 </p> <p>密     碼：身分證字號（預設） </p> <br><br> <p>人力資源處</p>', 0, '2017-11-09 02:08:04'),
(26, 'yearly_division_done', '【年度考評 - 批准通知】{year} 年 年度考核已全數批准 ', '<h3>您好：</h3><p> {year} 年度之年度考核已全數批准，請儘速完成作業，謝謝！<p> 入口網址: <a target="_blank" href="{URL}">{URL}</a> </p> <p> 帳     號：員編 </p> <p>密     碼：身分證字號（預設） </p> <br><br> <p>人力資源處</p>', 0, '2017-11-09 02:35:23');
