(2, 'normal', '改善', '在本年度的工作中，您覺得受評主管有哪些是可以改善，進而促進上司與部屬之間的關係？', 2, 1),
(3, 'others', '建議', '除了您的受評主管之外，對於其它部門主管，是否有任何是您想提出嘉許或建議的？', 4, 0),
(4, 'normal', '建議', '在本年度的工作中，對於受評主管，是否有任何是您想提出建議的？', 3, 1),
(5, 'others', '建議', '除了您的受評主管之外，對於其它單位主管，是否有任何是您想提出嘉許或建議的？', 4, 1),
(6, 'company', '建議', '其它建議：（針對公司，是否還有其它您想特別說明/補充呢？）', 5, 1);
