(203, 2017, 3, 0, 13, 2, 0, 5, '資深人資專員', '一般人員(行政/專技)', 5, 1, 0, '["2","1"]', '{"3":[13,2],"2":[2,2],"1":[1,1]}', '-', 89.09, '{"late":1,"early":0,"nocard":0,"forgetcard":0,"leave":5,"paysick":2,"physiology":0,"sick":0,"absent":0,"overtime":0,"relax":6,"other_vt":8,"other_ot":0}', '{"self":{"percent":40,"total":97,"score":{"1":19,"9":4,"7":4,"4":4,"5":4,"8":4,"10":4,"2":19,"11":4,"3":19,"6":4,"12":4,"13":4}},"2":{"percent":20,"total":96,"score":{"1":18,"9":4,"7":4,"4":4,"5":4,"8":4,"10":4,"2":18,"11":4,"3":20,"6":4,"12":4,"13":4}},"3":{"percent":40,"total":96,"score":{"1":18,"9":4,"7":4,"4":4,"5":4,"8":4,"10":4,"2":18,"11":4,"3":20,"6":4,"12":4,"13":4}}}', '{"s":[3,1511318517],"2":[2,1511318670],"c":[2,1511419867],"f":[1,1511420326]}', 96.00, -6, 6, 'A', '今年度在公司的主要貢獻：', '未來需要加強及改進之處：', '{"2":{"staff_id":2,"content":"真的不錯~棒棒"},"1":{"staff_id":1,"content":""}}', '', '2017-11-23 06:58:46', '2017-11-22 02:15:10'),
(204, 2017, 245, 0, 7, 2, 0, 5, '行政人員', '一般人員(行政/專技)', 5, 1, 0, '["2","1"]', '{"3":[7,2],"2":[2,2],"1":[1,1]}', '-', 58.00, '{"late":0,"early":0,"nocard":0,"forgetcard":0,"leave":0,"paysick":0,"physiology":0,"sick":0,"absent":0,"overtime":0,"relax":0,"other_vt":0,"other_ot":0}', '{"self":{"percent":40,"total":93,"score":{"1":19,"9":4,"7":4,"4":4,"5":4,"8":4,"10":4,"2":17,"11":4,"3":17,"6":4,"12":4,"13":4}},"2":{"percent":20,"total":100,"score":{"1":20,"9":4,"7":4,"4":4,"5":4,"8":4,"10":4,"2":20,"11":4,"3":20,"6":4,"12":4,"13":4}},"3":{"percent":40,"total":100,"score":{"1":20,"9":4,"7":4,"4":4,"5":4,"8":4,"10":4,"2":20,"11":4,"3":20,"6":4,"12":4,"13":4}}}', '{"s":[245,1511317590],"2":[2,1511317697],"c":[2,1511419867],"f":[1,1511420326]}', 97.00, 0, 0, 'A', '我覺得我~真的hen棒棒', '첫눈에 널 알아보게 됐어\n\n第一眼認出你了\n\n서롤 불러왔던 것처럼\n\n像是互相呼喚\n\n내 혈관 속 DNA가 말해줘\n\n我血液裡的 DNA 告訴我\n\n내가 찾아 헤매던 너라는 걸\n\n我曾經徘徊尋找的是你\n\n우리 만남은 수학의 공식\n\n我們的相遇是數學公式\n\n종교의 율법 우주의 섭리\n\n宗教的戒律 宇宙的規律\n\n내게 주어진 운명의 증거\n\n給我命運的證據\n\n너는 내 꿈의 출처\n\n你是我夢想的來源\n\nTake it take it\n\n너에게 내민 내 손은 정해진 숙명\n\n向你伸出我的手是註定好的宿命\n\n걱정하지 마 love\n\n不要擔心 love\n\n이 모든 건 우연이 아니니까\n\n因為這一切都不是偶然的\n\n우린 완전 달라 baby\n\n我們截然不同 baby\n\n운명을 찾아낸 둘이니까\n\n因為我們找到了命運\n\n우주가 생긴 그 날부터 계속\n\n從宇宙誕生的那天開始 繼續\n\n무한의 세기를 넘어서 계속\n\n跨越無限的世紀 繼續\n\n우린 전생에도 아마 다음 생에도\n\n我們在前世也好 在下輩子也好\n\n영원히 함께니까\n\n都會永遠在一起\n\n이 모든 건 우연이 아니니까\n\n因為這一切都不是偶然的\n\n운명을 찾아낸 둘이니까\n\n因為我們找到了命運\n\nDNA\n\nI want it this love\n\nI want it real love\n\n난 너에게만 집중해\n\n我只對你集中\n\n좀 더 세게 날 이끄네\n\n再更強烈的引領我\n\n태초의 DNA 가 널 원하는데\n\n天生的 DNA 我想要你\n\n이건 필연이야 I love us\n\n這是必然的啊 I love us\n\n우리만이 true lovers\n\n只有我們是 true lovers\n\n그녀를 볼 때마다 소스라치게 놀라\n\n看到那女孩的時候 都會大吃一驚\n\n신기하게 자꾸만 숨이 멎는 게\n\n總是神奇的停止呼吸\n\n참 이상해 설마\n\n真是奇怪 難道\n\n이런 게 말로만 듣던\n\n這就是傳說中的\n\n사랑이란 감정일까\n\n愛情的感情嗎', '{"2":{"staff_id":2,"content":"真的 hen 棒棒阿 吃菜棒還是吃肉棒"},"1":{"staff_id":1,"content":""}}', '', '2017-11-23 06:58:46', '2017-11-22 02:15:10'),
